package main

import (
	"container/heap"
	"fmt"
)

type MaxHeap []int

func (h MaxHeap) Len() int {
	return len(h)
}

func (h MaxHeap) Less(i, j int) bool {
	return h[i] > h[j]
}

func (h *MaxHeap) Swap(i, j int) {
	(*h)[i], (*h)[j] = (*h)[j], (*h)[i]
}

func (h *MaxHeap) Push(x interface{}) {
	*h = append(*h, x.(int))
}

func (h *MaxHeap) Pop() interface{} {
	res := (*h)[len(*h)-1]
	*h = (*h)[:len(*h)-1]
	return res
}

func minStoneSum(piles []int, k int) int {
	h := make(MaxHeap, 0)
	heap.Init(&h)
	for _, v := range piles {
		heap.Push(&h, v)
	}

	for i := 0; i < k; i++ {
		newPile := heap.Pop(&h).(int)
		newPile = (newPile + 1) / 2
		heap.Push(&h, newPile)
	}

	sum := 0
	for _, v := range h {
		sum += v
	}
	return sum
}

